		function topkek.libutil:createObject(o, p)
	
			local a, b = pcall(function()
	
				Instance.new(o)
	
			end)
	
			if not a then
	
				return
	
			end
	
			local obj = Instance.new(o)
	
			for prop, val in pairs(p) do
	
				pcall(function()
	
