		function topkek.libutil:recurseRemove(type_)
	
			local function recurse(x)
	
				for i, v in pairs(x:GetChildren()) do
	
					pcall(function()
	
						if v:IsA(type_) then
	
							v:Destroy()
	
						end
	
						if #(v:GetChildren())>0 then
	
							recurse(v)
	
						end
	
					end)
	
				end
	
			end
	
			recurse(game)
	
		end
	
