		function topkek.libgui:addLeftIcon(parent, img, sz)
	
			topkek.libutil:createObject('ImageLabel', {
	
				Parent = parent;
	
				BackgroundTransparency = 1;
	
				Position = UDim2.new(0, 2, 0, 0);
	
				Size = UDim2.new(0, sz, 0, sz);
	
				Image = img;
	
			})
	
