	local cango = true
	local sbutton = script.Parent
	local page = script.Parent.Parent
	local tweenService = game:GetService("TweenService")
	
	-- Open and closed positions
	local openPos = UDim2.new(0, 300, 0.295, 0) -- Open position
	local closedPos = UDim2.new(-0.00299600535, 3, 0.294712126, 0) -- Closed position
	
	-- Tween settings
	local tweenInfo = TweenInfo.new(0.5, Enum.EasingStyle.Quad, Enum.EasingDirection.Out)
	
	sbutton.MouseButton1Down:Connect(function()
		if cango then
			cango = false
			local targetPos
	
			if page.Position == openPos then
				targetPos = closedPos
				sbutton.Text = ">"
			else
				targetPos = openPos
				sbutton.Text = "<"
			end
	
			-- Create and play the tween animation
			local tween = tweenService:Create(page, tweenInfo, { Position = targetPos })
			tween:Play()
	
			-- Wait for tween to complete
			tween.Completed:Wait()
			cango = true
		end
	end)
	
end;
